import styled from "styled-components";

const Container = styled.div`
    position:absolute;
    width:100%;
    height:100%;
    background-color:#d5def5;
    display:flex;
    
`;

const ImgContainer = styled.div`
    position:absolute;
    width:200px;
    height:200px;
    background-color:red;
    margin:20px;
    overflow:hidden;
    border-radius:5px;

    img{
      position:absolute;
      width:100%;
      height:100%;
      background-position:center;
    }

    &:hover{
      background-color:lime;
    }
`;



function AnimalControl({item}) {
  return (
    <Container>
      <ImgContainer>
        <img src={item.Image}/>
      </ImgContainer>
    </Container>
     
  )
}

export default AnimalControl;
